int32 UT_DefaultStubImpl(const char *FunctionName, UT_EntryKey_t FuncKey, int32 DefaultRc, ...)
{
    int32   Retcode;
    va_list va;

    /* Open log file (append) to record control flow and relevant state */
    FILE *log = fopen("/tmp/logs/438.txt", "a");
    if (log)
    {
        fprintf(log, "ENTER UT_DefaultStubImpl\n");
        fprintf(log, "  FunctionName: %s\n", (FunctionName != NULL) ? FunctionName : "(null)");
        /* Cast FuncKey to unsigned long long for robust printing across typical integer typedefs */
        fprintf(log, "  FuncKey (as ull): %llu\n", (unsigned long long)FuncKey);
        fprintf(log, "  DefaultRc: %d\n", (int)DefaultRc);
        fflush(log);
    }

    va_start(va, DefaultRc);
    if (log)
    {
        fprintf(log, "  va_start called\n");
        fflush(log);
    }

    Retcode = UT_DefaultStubImplWithArgs(FunctionName, FuncKey, DefaultRc, va);

    if (log)
    {
        fprintf(log, "  UT_DefaultStubImplWithArgs returned: %d\n", (int)Retcode);
        fflush(log);
    }

    va_end(va);
    if (log)
    {
        fprintf(log, "  va_end called\n");
        fprintf(log, "EXIT UT_DefaultStubImpl -> Retcode: %d\n\n", (int)Retcode);
        fclose(log);
    }

    return Retcode;
}
